import 'moment/locale/fr'
import React from 'react'
import AppBar from '@mui/material/AppBar'
import Box from '@mui/material/Box'
import Toolbar from '@mui/material/Toolbar'
import moment from 'moment'
import styled from 'styled-components'
import ListItem from '@mui/material/ListItem'
import { useHistory } from 'react-router-dom'

const SToolbar = styled(Toolbar)`
  display: flex;
  justify-content: space-between;
`
const ListContainer = styled.div`
  display: flex;
  width: 35vw;
  justify-content: space-between;
  padding: 0 3em;
`
const Header = styled.div`
  display: flex;
  padding: 0 1em;
`
const Footer = styled.div`
  padding: 0 1em;
`

const Navbar = () => {
  const history = useHistory()
  const date = moment().locale("fr").format('LL');

  const pages = [
    {
      name: "Accueil",
      path: "/home"
    },
    {
      name: "Profil",
      path: "/profil"
    },
    {
      name: "L'Entreprise et Moi",
      path: "/numerisk_and_me"
    },
    {
      name: "Situations Professionelles",
      path: "/professionals_situations"
    },
    {
      name: "Annexes",
      path: "/annexes"
    },
  ]

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <SToolbar>
          <Header>
            <img src="https://www.cipecma.com/templates/cipecma/images/logo.png" alt="Logo Cipecma" width="100px" height="55px"/>
            <ListContainer>
              {pages.map((page) => (
                <ListItem onClick={() => {history.push(page.path)}}>
                  {page.name}
                </ListItem>
              ))}
            </ListContainer>
          </Header>
            {date}
        </SToolbar>
      </AppBar>
    </Box>
  )
}

export default Navbar
